window.makePassFBO = makePassFBO;
window.makeDoubleBuffer = makeDoubleBuffer;
window.loadImage = loadImage;
window.loadText = loadText;
window.makeFullScreenQuad = makeFullScreenQuad;
window.make1DTexture = make1DTexture;
window.makePass = makePass;
window.makePipeline = makePipeline;


